import React from 'react';

const Header = () => {
  return (
    <header>
      <h1>Звукова Студія</h1>
      <nav>
        <ul>
          <li><a href="/">Home</a></li>
          <li><a href="/about">About</a></li>
          <li><a href="/services">Services</a></li>
          <li><a href="/portfolio">Portfolio</a></li>
          <li><a href="/director">Director</a></li>
          <li><a href="/more-services">More Services</a></li>
          <li><a href="/clients">Clients</a></li>
          <li><a href="/contacts">Contacts</a></li>
          {/* Додайте інші посилання за потребою */}
        </ul>
      </nav>
      
      {/* Додайте навігаційне меню тут */}
      <nav>
        {/* Додайте посилання на різні сторінки */}
        <a href="#intro">Ласкаво просимо</a>
        <a href="#about">Про Нас</a>
        {/* Додайте інші посилання на ваш вибір */}
      </nav>
    </header>
  );
};

export default Header;
